import "./Carrousel.css";

function Carrousel(props) {
  const { img_carrousel } = props;
  return (
    <div className="kasa-carrousel">
      <img className="kasa-carrousel-img" src={img_carrousel} alt="Logement" />
    </div>
  );
}

export default Carrousel;
